import './App.css';
import { Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
    <Routes>
    <Route path='/' element={<div className='text-center'>hello</div>}></Route>
    </Routes>
    </div>
  );
}

export default App;
